    render() {
        return (
            <div className="row pt-2 align-text-bottom">
                <div className="logo">
                    <a className="navbar-brand" href="#">
                        <img src={logo} style={{height: 50}}/>
                    </a>
                </div>
                <p className="selectItem">Acceuil</p>
